// src/components/Layout.js
import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <nav>
        <div className="container">
          <div class="row">
            <div className="column one-third small">
              <h4>
                <Link to="/about">
                  Who is this guy?
                </Link>
              </h4>
            </div>
            <div className="column one-third large">
              <Link to="/">
                Andrew Fitzpatrick
              </Link>
            </div>
            <div className="column one-third small">
              <Link to="/contact">
                Contact
              </Link>
            </div>
          </div>
        </div>
      </nav>
    </header>
  );
};

export default Header;
